from .. import loader, utils

import logging
import asyncio
from PIL import Image, ImageOps
from io import BytesIO
from base64 import b64decode as b64

logger = logging.getLogger(__name__)


@loader.tds
class CodefyMod(loader.Module):
    """Makes message monospace"""
    strings = {"name": "Keyboard typer"}

    @loader.ratelimit
    async def keyboardcmd(self, message):
        """.keyboard <text or reply>"""
        uinp = utils.get_args(message)
        if not uinp:
            get = await message.get_reply_message()
            if not get:
                uinp = '`1234567890-=\][poiuytrewqasdfghjkl;\'\n/.,mnbvcxz '
            else:
                uinp = get.raw_text
        else:
            uinp = " ".join(uinp)

        text = uinp.lower().strip()
        if len(text) == 0:
            text = '`1234567890-=\][poiuytrewqasdfghjkl;\'\n/.,mnbvcxz '
        await message.edit(' '.join([f'<code>{typing}</code>' for typing in 'Печатаю...']))
        keyboard_bytes = b''
        keys = {'`': (19, 8), '~': (19, 8), 'ё': (19, 8), '1': (114, 8), '!': (114, 8), '2': (209, 8), '@': (209, 8), '3': (304, 8), '#': (304, 8), '№': (304, 8), '4': (399, 8), ';': (1051, 203), '$': (399, 8), '5': (494, 8), '%': (494, 8), '6': (589, 8), '^': (589, 8), ':': (1051, 203), '7': (684, 8), '?': (1101, 302), '&': (684, 8), '8': (779, 8), '*': (779, 8), '9': (874, 8), '(': (874, 8), '0': (969, 8), ')': (969, 8), '-': (1064, 8), '_': (1064, 8), '=': (1159, 8), '+': (1159, 8), 'q': (166, 104), 'й': (166, 104), 'ц': (261, 104), 'w': (261, 104), 'e': (356, 104), 'у': (356, 104), 'к': (451, 104), 'r': (451, 104), 't': (546, 104), 'е': (546, 104), 'н': (641, 104), 'y': (641, 104), 'u': (736, 104), 'г': (736, 104), 'ш': (831, 104), 'i': (831, 104), 'o': (926, 104), 'щ': (926, 104), 'з': (1021, 104), 'p': (1021, 104), '[': (1116, 104), '{': (1116, 104), 'х': (1116, 104), 'ъ': (1211, 104), '}': (1211, 104), ']': (1211, 104), '\\': (1306, 104), '|': (1306, 104), '/': (1101, 302), 'ф': (196, 203), 'a': (196, 203), 's': (291, 203), 'ы': (291, 203), 'в': (386, 203), 'd': (386, 203), 'f': (481, 203), 'а': (481, 203), 'п': (576, 203), 'g': (576, 203), 'h': (671, 203), 'р': (671, 203), 'о': (766, 203), 'j': (766, 203), 'k': (861, 203), 'л': (861, 203), 'д': (956, 203), 'l': (956, 203), 'ж': (1051, 203), "'": (1146, 203), '"': (1146, 203), 'э': (1146, 203), 'я': (246, 302), 'z': (246, 302), 'x': (341, 302), 'ч': (341, 302), 'с': (436, 302), 'c': (436, 302), 'v': (531, 302), 'м': (531, 302), 'и': (626, 302), 'b': (626, 302), 'n': (721, 302), 'т': (721, 302), 'ь': (816, 302), 'm': (816, 302), ',': (1101, 302), '<': (911, 302), 'б': (911, 302), 'ю': (1006, 302), '>': (1006, 302), '.': (1101, 302), ' ': (361, 401), '\n': (1240, 203), 'no_on_keyboard': (132, 401)}
        extra = {' ': 618, '\\': 132, '|': 132, '/': 132, '\n': 198, 'no_on_keyboard': 110}
        keyboard = Image.open(BytesIO(b64(keyboard_bytes)))
        frames = []
        for bykva in text:
            temp = keyboard.copy()
            if bykva not in keys:
                bykva = 'no_on_keyboard'
            xp, yp = keys[bykva]
            length = 90
            if bykva in extra:
                length = extra[bykva]
            pressed = temp.crop((xp, yp, xp + length, yp + 90))
            pressed = ImageOps.invert(pressed)
            temp.paste(pressed, (xp, yp))
            frames.append(temp)
        output = BytesIO()
        output.name = "sub_to_@KeyZenD.gif"
        keyboard.save(output, "GIF", save_all=True, append_images=frames, duration=250)
        output.seek(0)
        await utils.answer(message, output)
